import React from 'react'
import app from './Confi/firebase.js';
import {getAuth, signOut} from 'firebase/auth'
const auth = getAuth(app);

function Home() {

  return(
    <div>
     <h1>Home</h1>
    <img src="img/screen-5 (1)" width="30" height="30"/>

     <button className="input-group-append" onClick={() => signOut(auth)}> Cerrar sesion </button>
    </div>
    )

  
}

export default Home;
